import React from "react";
import "./App.css";
const Navl=()=>{
    return(
        <div className="navl">
            <div className="navl1">
               <div className="navlimg">
                <img src="/images/images3.png" alt="imggggg" />
               </div>
                <span><a>dibyajyotio</a></span>
            </div>
        </div>
    );
}
export default Navl;
